Information
------------------------------

Breaking into Britain: The Lorry Jumpers 
Leo Maguire tells the stories of the migrants amassed in camps Calais, joining them as they attempt to evade security guards and police to get into the back of lorries and waiting with them in the trailers as they try to make the channel crossing undiscovered. Shot over the course of a year, the programme follows a selection of people who have each fled their homeland in the hope of starting a new life in the UK

